B.aKP=A.a(s(["Aerozoli\u0173 balion\u0117liai, kuriuose yra pavojing\u0173j\u0173 ir nepavojing\u0173j\u0173 med\u017eiag\u0173 liku\u010di\u0173: aerozoli\u0173 balion\u0117liai su med\u017eiag\u0173 liku\u010diais originalioje gamintojo pakuot\u0117je turi b\u016bti r\u016b\u0161iuojami atskirai kaip pavojingosios atliekos.","Tu\u0161ti aerozoli\u0173 balion\u0117liai (tai nustatoma paspaudus pur\u0161kimo mygtuk\u0105 \u2013 jei i\u0161 balion\u0117lio niekas nepasklinda, tokia aerozolio pakuot\u0117 laikoma tu\u0161\u010dia), kuriuose buvo pavojing\u0173j\u0173 med\u017eiag\u0173 ir mi\u0161ini\u0173, tvarkomos kaip pavojingomis med\u017eiagomis u\u017eter\u0161tos pakuot\u0117s."]),t.s)
